import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { ChevronDown, Shield, Clock, CheckCircle } from 'lucide-react';

const FAQ = () => {
  const [openIndex, setOpenIndex] = useState(null);

  const faqs = [
    {
      question: "Is map embed stacking safe?",
      answer: "Yes—fully white-hat, tiered, IP-diverse, with satisfaction commitment. Our map embed stacking strategy uses only legitimate, high-authority websites and follows Google's guidelines. We use a tiered approach with diverse IP addresses to ensure natural link building patterns. If you're not satisfied with the results, we offer a full refund."
    },
    {
      question: "When can I expect results?",
      answer: "Most clients see Map Pack rankings in 30–60 days. While every business and market is different, our average client starts seeing improvements in their Google Maps rankings within 30-60 days. Some competitive markets may take longer, but we provide regular updates and will work extra hard if results take longer than expected."
    },
    {
      question: "What makes your local SEO different?",
      answer: "We focus specifically on Google Maps domination with proven strategies that work. Unlike general SEO agencies, we specialize in local search and have developed proprietary techniques for map embed stacking, GBP optimization, and local authority building that consistently deliver results."
    },
    {
      question: "Do you work with my industry?",
      answer: "Yes, we work with contractors, clinics, service professionals, and local businesses across all industries. Our local SEO strategies are effective for any business that serves a local market, from plumbers and dentists to law firms and restaurants."
    },
    {
      question: "What if I don't see results?",
      answer: "We offer a 30-day results guarantee. If you don't see improvements in your local rankings within 30 days, we'll either work extra hard to get you results or give you a full refund. No questions asked. Your success is our priority."
    },
    {
      question: "How do you track my progress?",
      answer: "We provide monthly ranking reports showing your progress, call volume analysis, competitor monitoring, and performance insights. You'll receive detailed reports every month showing exactly how your local SEO campaign is performing and what improvements we're seeing."
    }
  ];

  const toggleFAQ = (index) => {
    setOpenIndex(openIndex === index ? null : index);
  };

  return (
    <section className="py-20 bg-white">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section Header */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-primary-900 mb-6">
            FAQ & Guarantee
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Common questions about our local SEO services and our commitment to your success
          </p>
        </motion.div>

        <div className="max-w-4xl mx-auto">
          {/* FAQ Items */}
          <div className="space-y-4 mb-16">
            {faqs.map((faq, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                viewport={{ once: true }}
                className="bg-gray-50 rounded-2xl overflow-hidden"
              >
                <button
                  onClick={() => toggleFAQ(index)}
                  className="w-full px-8 py-6 text-left flex items-center justify-between hover:bg-gray-100 transition-colors duration-200"
                >
                  <h3 className="text-lg font-semibold text-primary-900 pr-4">
                    {faq.question}
                  </h3>
                  <ChevronDown 
                    className={`w-6 h-6 text-gray-500 transition-transform duration-200 ${
                      openIndex === index ? 'rotate-180' : ''
                    }`} 
                  />
                </button>
                <AnimatePresence>
                  {openIndex === index && (
                    <motion.div
                      initial={{ height: 0, opacity: 0 }}
                      animate={{ height: 'auto', opacity: 1 }}
                      exit={{ height: 0, opacity: 0 }}
                      transition={{ duration: 0.3 }}
                      className="overflow-hidden"
                    >
                      <div className="px-8 pb-6 text-gray-700 leading-relaxed">
                        {faq.answer}
                      </div>
                    </motion.div>
                  )}
                </AnimatePresence>
              </motion.div>
            ))}
          </div>

          {/* Guarantee Cards */}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-16">
            <motion.div
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6 }}
              viewport={{ once: true }}
              className="bg-gradient-to-br from-green-50 to-green-100 rounded-2xl p-8 text-center"
            >
              <div className="w-16 h-16 bg-green-500 rounded-2xl flex items-center justify-center mx-auto mb-6">
                <Shield className="w-8 h-8 text-white" />
              </div>
              <h3 className="text-xl font-bold text-green-900 mb-4">
                30-Day Guarantee
              </h3>
              <p className="text-green-800">
                If you don't see improvements in your local rankings within 30 days, we'll work extra hard or give you a full refund.
              </p>
            </motion.div>

            <motion.div
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.1 }}
              viewport={{ once: true }}
              className="bg-gradient-to-br from-blue-50 to-blue-100 rounded-2xl p-8 text-center"
            >
              <div className="w-16 h-16 bg-blue-500 rounded-2xl flex items-center justify-center mx-auto mb-6">
                <Clock className="w-8 h-8 text-white" />
              </div>
              <h3 className="text-xl font-bold text-blue-900 mb-4">
                Fast Results
              </h3>
              <p className="text-blue-800">
                Most clients see Map Pack rankings in 30-60 days with our proven local SEO strategies.
              </p>
            </motion.div>

            <motion.div
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.2 }}
              viewport={{ once: true }}
              className="bg-gradient-to-br from-orange-50 to-orange-100 rounded-2xl p-8 text-center"
            >
              <div className="w-16 h-16 bg-orange-500 rounded-2xl flex items-center justify-center mx-auto mb-6">
                <CheckCircle className="w-8 h-8 text-white" />
              </div>
              <h3 className="text-xl font-bold text-orange-900 mb-4">
                White-Hat Methods
              </h3>
              <p className="text-orange-800">
                All our techniques are fully white-hat and follow Google's guidelines for safe, sustainable results.
              </p>
            </motion.div>
          </div>

          {/* CTA Section */}
          <motion.div 
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="text-center"
          >
            <div className="bg-gradient-to-r from-primary-900 to-primary-800 rounded-3xl p-8 md:p-12 text-white">
              <h3 className="text-3xl font-bold mb-4">
                Ready to Dominate Your Local Market?
              </h3>
              <p className="text-xl text-gray-200 mb-8 max-w-2xl mx-auto">
                Join hundreds of local businesses already ranking in the Google Map Pack with our proven strategies.
              </p>
              <div className="flex flex-col sm:flex-row gap-4 justify-center">
                <button className="bg-orange-500 hover:bg-orange-600 text-white px-8 py-4 rounded-xl font-semibold text-lg transition-all duration-300 transform hover:scale-105">
                  Book Free Strategy Call
                </button>
                <button className="bg-white/10 hover:bg-white/20 text-white px-8 py-4 rounded-xl font-semibold text-lg transition-all duration-300 border border-white/20">
                  View Our Packages
                </button>
              </div>
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default FAQ;
